import { DateTimePicker as MaterialDateTimePicker } from '@material-ui/pickers';

import styled from 'styled-components';

import MaterialTextField from '@material-ui/core/TextField';
import MaterialFormControl from '@material-ui/core/FormControl';

export const TextField = styled(MaterialTextField)`
margin-top: 24px;
`;

export const FormControl = styled(MaterialFormControl)`
margin-top: 24px;`;

export const DateTimePicker = styled(MaterialDateTimePicker)`
margin-top: 24px;`;
